C.a.defaultSkin='Controls the skin Genie will use when none is otherwise specified. This defaults to "Hybrid".';C.a.enableDesigner="Determines whether the Design Toolbar will be enabled. This defaults to true.";C.a.adjustColumns="When set to true, Genie will use the field's attribute position when assigning its column number. This behavior is compatible with Profound UI versions prior to 3 and with the older stand-alone Genie versions. When set to false, Genie will assign the field's actual start position (as given in DDS) as the column number. The default value is false.";
C.a.connectionType="Determines the type of connection used to exchange 5250 streams with the server. WebFacing Server connections (Genie Accelerator) do not use interactive processing. However, the following features are not supported through the WebFacing Server: custom workstation ids, automated sign on, and assignment of client IP address to workstation device. The default is to use a Virtual Terminal connection.";C.a.host='The IP address or host name to use when connecting to the WebFacing server. This defaults to the "localhost".';
C.a.port="The port on which to connect to the WebFacing Server. This defaults to port 4004.";C.a.workStnFieldId='Upon successful sign on, Genie will store information about the 5250 session job for later use. Genie retrieves this information by detecting the session\'s workstation id on the sign on screen. This setting specifies the Genie field id on the sign on screen that will be used to retrieve the workstation id. This defaults to "D_4_69".';C.a.pcListener='If set to true, the PC Command Listener will be used instead of the PC Integration Applet for running PC commands for STRPCCMD and the "runPCCommand()" API. The PC Command Listener is a separate installation on the PC. The PC Integration Applet requires that Java is installed on the PC and that the web browser supports the Java plug-in. The default value is false.';
C.a.listenerPort="Sets the port number for connections to the PC Command Listener. If not set, Genie will connect on port 80.";C.a.closeMessage='Additional message text to display in the confirmation prompt when "Confirm on Close" the user tries to end the session abnormally -- such as closing down the browser.';C.a.detectSubfile="Determines whether Genie should look for subfiles on each screen.  The default value is true.";C.a.detectSubfilePatterns="This flag tells Genie to look for a subfile by detecting a pattern of rows that are formatted in the same way.  When a subfile is detected using this method, a grid widget is created over it.  If the flag is not set to true, Genie looks for Option Headings, instead, in order to detect the subfile.";
C.a.detectSubfileEndPlus="When \"detect subfile patterns\" is selected, this flag will allow Genie to recognize a 1A output field ususlly containing a '+' on the end of the last row so it will not interrupt the pattern detection. The default value for this property is true.";C.a.findOptionColumn='When "Detect Subfile Patterns" is selected, this flag is used to prevent false positives by only creating grids on subfiles where an Option Column exists.';C.a.pagingBar='When "Detect Subfile Patterns" is selected and this flag is set to "true", the subfile grid widget will include a paging bar. When set to "false" a paging scrollbar will be used. The default value is "false".';
C.a.optionHeadings='Specifies a comma separated list of headings to look for to identify a subfile option column.  This method of detecting subfiles is used only when the "Detect Subfile Patterns" option is not selected.  The default value for this property is OPT,SEL.';C.a.outlineSubfile="If a subfile is found using the Option Headings method, this flag determines whether an outline is drawn around the subfile area.";C.a.subfileOutlineColor='Sets the outline color when the "Outline Subfiles" option is used. This can be give either as a CSS color name, such as "red", or as a hex code, such as "#FF0000". The default color is "yellow".';
C.a.separateSubfileLines="If a subfile is found using the Option Headings method, this flag determines whether a separator line is drawn between each subfile line.";C.a.hideSubfileOpt="If a subfile is found using the Option Headings method, this flag tells Genie to find and hide an option input box on each subfile line.  Instead of using the input box, the user will be able to right-click the subfile to select the appropriate option.";C.a.stripedSubfile="Determines if the subfile rows are striped with alternate colors.";
C.a.oddRowColor="The color of the odd rows in a striped subfile.";C.a.evenRowColor="The color of the even rows in a striped subfile.";C.a.hiColor="Defines the color of the row when it is hovered over with the mouse.";C.a.hiFontColor="Defines the color of the text within the row when the row is hovered over with the mouse.";C.a.multX="Controls the horizontal spacing between fields. The field's column number is multiplied by this number to derive the pixel offset from the left edge of the 5250 area.";
C.a.multY="Controls the vertical spacing between fields. The field's row number is multiplied by this number to derive the pixel offset from the top edge of the 5250 area.";C.a.inputPadding="Extra width (in pixels) to assign to input fields. This can be used to adjust for input field border styling, variations in font rendering, etc. Defaults to 4 if not specified.";C.a.alertErrors="When set to true, Genie presents green-screen errors in an alert box.  When set to false, errors are displayed at the bottom of the screen only.";
C.a.detectDateFields="When set to true, Genie looks for date fields on this screen and automatically attaches a calendar control to any field that it finds.";C.a.defaultDateFormat="Defines the default date format to be used in calendar controls.";C.a.locale="Defines a locale that can be used to control various settings. Currently, only the text display for month and day names on the calendar widget is affected by this setting.";C.a.detectMenus="When set to true, Genie will attempt to detect menu panels and transform the menu options into hyperlinks. The default value is true.";
C.a.enlargeHeadings="When set to true, Genie looks for the screen heading and automatically increases its font size and adds a shadow.";C.a.functionKeyButtons='Determines whether function key labels, such as "F3=Exit", are transformed into buttons.';C.a.hideFKeyNames='Tells Genie to look for function key labels and remove the function key name.  For example, "F3=Exit" becomes "Exit".  The user will be able to click on the field to send the appropriate function key to the server.';
C.a.overtypeMode="Determines if the default keyboard cursor mode is overtype or insert.  In overtype mode, the characters you type replace existing characters one by one.  In insert mode, the characters you type move existing text to the right.  The default value is true.";C.a.highlightOnFocus="Highlights text in input fields when focus is received.  The default value is false.";C.a.preventAutoTab="If set to false, Genie overrides the browser's default behavior of the Tab key with its own automatic tabbing.  If set to true, the browser's default behavior is used for tabbing.  The default value is false.";
C.a.setFieldBackground="If set to true, Genie will set the background color of all fields to the match the main screen background color, preventing any underlying items from showing through. If set to false, all fields will be given a transparent background, allowing any underlying items to show through. The default value is false.";C.a.useFixedFont="If set to true, Genie will set the font for all screens to Monospace. If set to false, Genie will use the font specified in the style sheet for this skin. The default value is false.";
C.a.detectWindowBorder="If set to true, Genie will detect window border fields (such as a string of dots) and apply the browser's default monospace font to them. The default value is true.";C.a.autoSizeFont="When set to true, Genie will automatically adjust the font size and spacing when the size of the browser window changes.";C.a.browserAutoComplete="When set to true, Genie will enable the browser to store previous form entries and suggest matches for the user as they type.  The default value is false.  The Auto Complete feature (also known as the Auto Fill feature in some browsers) must be enabled within browser settings.  If this feature is enabled, Overtype Mode should be set to false.";
